import React from 'react'
import Moment from 'react-moment'

import { MenuItem, Typography, Grid, Avatar } from '@material-ui/core'
import { useStyles } from './styleResult'

const AlertResult = props => {
  const classes = useStyles()

  const date = new Date(props.created)
    .toUTCString()
    .toString('yyyy-mm-dd, h:MM:ss ')

  return (
    <MenuItem
      onClick={props.handleClose}
      key={props.key}
      className={classes.root}
    >
      <Grid container spacing={1}>
        <Grid item xs={9} className={classes.overFlowText}>
          <Typography variant='caption'>{date}</Typography>
          <Typography
            variant='h6'
            style={{ color: props.read ? '#888888' : '' }}
          >
            {props.title}{' '}
          </Typography>
          <Typography variant='subtitle1'>{props.scene_name}</Typography>
          <Typography variant='subtitle1'>{props.project_name}</Typography>
        </Grid>
        <Grid item xs={3}>
          <Avatar variant='rounded' alt='title' src={props.img} />
        </Grid>
      </Grid>
    </MenuItem>
  )
}

export default AlertResult
